import React from "react";
import { Text, View,StyleSheet } from "react-native";

const Login = ({ params }) => {
  return (
    <View >
      <Text>Login</Text>
    </View>
  );
};

export default Login;
const styles = StyleSheet.create({
    container: {
        flex:1,
        backgroundColor: '#009387',
    }
    
});
